import React from 'react';

const ResultsPage = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold">Diagnosis Results</h1>
            <p>View your diagnosis results here.</p>
        </div>
    );
};

export default ResultsPage;
